import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import './resources/Form.css'

const Review = ({ setForm, formData, navigation }) => {
  const {
    temperature,
    address,
    city,
    state,
    zip,
    phone,
    email
  } = formData;
  const { go } = navigation;

  return (
    <div className="form">
      <h3>Review your data</h3>
      <h4> Hur hög är din kroppstemperatur? {' '}<Button onClick={() => go("temperature")}>Edit</Button>
      </h4>
      <div>
        {" "} Temperature: {`${temperature}`}
      </div>
      <h4>
        Address
        {' '}<Button onClick={() => go("address")}>Edit</Button>
      </h4>
      <div>
        Address: {`${address}`},
        <br />
        City: {` ${city}`},
        <br />
        State: {`${state}`},
        <br />
        ZIP: {`${zip}`}
      </div>
      <h4>
        Contact
        {' '}<Button onClick={() => go("breathing")}>Edit</Button>
      </h4>
      <div>
        Phone: {`${phone}`},
        <br />
        E-mail: {`${email}`}
      </div>
      <div>
        <Button onClick={() => go("submit")}>Submit</Button>
      </div>
    </div>
  );
};

export default Review;
